import axios from "axios"

const fetchImage = () => {

    return axios
        .get("https://pixabay.com/api/?q='moon&page=1&key=19685928-f191ac91b9da632ea9a4b744f&image_type=photo&orientation=horizontal&per_page=12")
        .then(res => res.data)
}

export default fetchImage;
